import React from "react";
import ".././App.css";

class Times extends React.Component {
  render() {
    return (
      <div>
        <h1>This page</h1>
        <input
          onSubmit={ev => {
            ev.preventDefault();
            this.props.handleSetState("login");
          }}
          type="submit"
          value="Voltar"
        />
      </div>
    );
  }
}

export default Times;
